import ExpenseItem from './ExpenseItem'

function Expenses() {
    const expenses =[{
        date: new Date(),
        amount: 150.23,
        title: 'Car Insurance'
    },
    {
        date: new Date(),
        amount: 500.69,
        title: 'Term Life'
    },
    {
        date: new Date(),
        amount: 160.13,
        title: 'Health'
    },
    {
        date: new Date(),
        amount: 160.13,
        title: 'LIC'
    }]
    return (
        <div>
            <ExpenseItem expenses={expenses[0]}/>
            <ExpenseItem expenses={expenses[1]}/>
            <ExpenseItem expenses={expenses[2]}/>
            <ExpenseItem expenses={expenses[3]}/>
        </div>
    )
}

export default Expenses;
